// ---------------BIBLIOTECAS DE SENSORES 

#include <RTClib.h> // controlar DS3231 la hora 
#include <DHT.h> // controlar el sensor dht22 y dht11 o dht21 temperatura y humedad 
#include <DHT_U.h>

// SETEAMOS EL CONTROL HORARIO

RTC_DS3231 rtc; // seteamos el modelo pa este caso RTC_DS3231 con el nombre rtc // -------mi reloj 

int year,mes,dia,hora,minuto,segundo; 

// pin 22 == scl y 21 == sda


// Definici√≥n de los pines y los tipos de sensor DHT22

#define DHTPIN1 23 // LINEA OUT DEL SENSOR DHT22
#define DHTTYPE DHT22 // SETEAMOS MODELO DHT22 O DHT11

// Inicializaci√≥n de los objetos DHT
DHT dht(DHTPIN1, DHTTYPE); // misensor mYdht22 parametro 1 == pin donde esta conectado el sensor , parametro2 == tipo del sensor dht22 o dht11

float temperatura; // se mide en decimales xx.xx
int humedad; // mide en porcentaje 

// configuracion de la bomba y control manual

#define bomba 14 // paramtro1 == nombre del objeto o variable parametro2 == pin donde essta conectado

bool estado_bomba = 1; // 0 y 1 encendido/apagado relay maneja logica inversa 

// control manual 

int pulsador = 13; // pull up == logica inversa o pull down == maneja logica clasica o normal 

bool estado_mantenimiento = 0; //pulldown

void setup() {
  // Inicializaci√≥n de la comunicaci√≥n serial
  Serial.begin(115200); 

  // Inicializaci√≥n de los sensores DHT
  dht.begin(); // el nombre del objeto del sensor . begin 

  rtc.begin(); // Inicia la comunicaci¬¢n con el RTC

  //rtc.adjust(DateTime(2024, 6, 27, 8,37, 30)); // a√±o, mes, dia, hora, min, segundo   ------------SOLO SE CORRE UNA VEZ ----------

  pinMode(bomba, OUTPUT); // PARAMETRO 1 == PIN DEL SENSOR O BOMBA , PARAMETRO 2 == CONFIGURAMOS COMO ENTRADA O SALIDA

